import React, { Fragment } from "react";
import { Route } from "react-router-dom";
import Page from "./MainPage/Page";

const App = () => {
  return (
    <Fragment>
      <Page />
      <Route path="/"></Route>
    </Fragment>
  );
};

export default App;
